import React , { Fragment } from 'react';
import { BrowserRouter as Router , Switch , Route } from 'react-router-dom';
import Home from './components/pages/Home';
import './App.css';
const App = () => {
    return (
        <Router>
            <Switch>
                <Route exact patch = '/' component = {Home} />
            </Switch>
        </Router>
    )
}

export default App
